let currentDate = new Date();
    var newDate;
    var days7=[];
    for (var i = 1; i <= 7; i++) {
      newDate = new Date(
        currentDate.getFullYear(),
        currentDate.getMonth(),
        currentDate.getDate() + i
      );
     days7.push(newDate.toDateString());
    }
    console.log(days7)
